import React from "react";
import styles from "../styles/cardComponent.module.css";

const DogCard = ({ dog }) => {
  return (
    <div>
    <div className={styles.cardContainer}>
      <h2 className={styles.title}>{dog.name}</h2>
      <div>
        <img src={dog.image} alt={dog.name} height='350px' width='400px'/>
        <p className={styles.cardInfo}>Pesa entre: {dog.weight} kg</p>
        <p className={styles.cardInfo}>Temperamentos: {dog.temperaments.join(", ")}</p>
      </div>
      <div class="gradient-overlay"></div>
      <div class="color-overlay"></div>
    </div>
    </div>
  );
};

export default DogCard;
